import React, { Component } from 'react';

class Consultas extends Component {
    
        constructor(props){
            super(props);
            this.state = {
                realizadas : [
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 },                
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 }
                ],
                marcadas : [
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 },                
                    { especialidade : "", quantidade : 0 },
                    { especialidade : "", quantidade : 0 }
                ],
            }
        }

      
        componentDidMount() {
            this.callApi()
              .then(dados => this.setState(dados))
              .catch(err => console.log(err));
          }
        
          callApi = async () => {
            const response = await fetch('http://devup.com.br/php/api-dashboard/api/consultas');
            const body = await response.json();
            if (response.status !== 200) throw Error(body.message);
        
            return body;
          };
        
        render(){
            return(
                <div>
                    <h2 className = "mt-2">Consultas</h2>

                    <div className="row">
                        <div className="col">
                            <div className="card mt-5 ml-5 mr-5">
                                <div className="card-header">
                                    Realizadas
                                </div>
                            <div className="table">
                                <thead>
                                    <tr> Especialidade</tr>
                                    <tr> Quantidade</tr>
                                </thead>
                                <body>
                                    {
                                        this.state.realizadas.map((item, indice) => {
                                            return(<tr key={indice}>
                                                    <td>{item.especialidade}</td>
                                                    <td>{item.quantidade}</td>
                                                </tr>)
                                        })
                                    }
                                </body>
                            </div>
                            </div>
                        </div>

                        <div className="col">
                            <div className="card mt-5 ml-5 mr-5">
                                <div className="card-header">
                                    Realizadas
                                </div>
                            <div className="table-active">
                                <thead>
                                    <tr> Especialidade</tr>
                                    <tr> Quantidade</tr>
                                </thead>
                                <body>
                                    {
                                        this.state.marcadas.map((item, indice) => {
                                            return(<tr key={indice}>
                                                    <td>{item.especialidade}</td>
                                                    <td>{item.quantidade}</td>
                                                </tr>)
                                        })
                                    }
                                </body>
                            </div>
                            </div>
                        </div>
                    </div>
                    
                </div>                           
        )
    }
}
export default Consultas;
